import React from "react";
import Entry from './Entry';

function CreateEntry(entry){
 return (
   <Entry
     key={entry.id}
     name={entry.name}
     emoji={entry.emoji}
     meaning={entry.meaning}
   />
 );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      {entry.map(CreateEntry)}
    </div>
  );
}

export default App;
